    			$x = 50;
    			$y = 30;
    			$width = 180;
    			break;

    		case "C2":
    			$x = 70;
    			$y = 50;
    			$width = 140;
    			break;

    		case "G":
    			$x = 35;
    			$y = 45;
    			$width = 225;
    			break;

    		case "P52.01":
    			$x = 35;
    			$y = 50;
    			$width = 225;
    			break;

    		case "P52.03":
    			$x = 55;
