    			$width = 200;
    			break;

    		case "P72.03":
    			$x = 60;
    			$y = 45;
    			$width = 180;
    			break;

    		case "O0.207":
    			$x = 25;
    			$y = 55;
    			$width = 240;
    			break;

    		case "O1.267":
    			$x = 85;
    			$y = 50;
    			$width = 120;
    			break;

    		case "L1":
    		case "L2":
    			$x = 80;
    			$y = 30;
    			$width = 140;
    			break;

    		case "L1.202":
    			$x = 80;
    			$y = 30;
    			$width = 140;
    			break;

        case "L2.202":
          $x = 54;
          $y = 90;
          $width = 503;
          break;

    		case "Eggelandhalle":
    			$x = 100;
    			$y = 30;
    			$width = 140;
    			break;

    		// any case where no plan is available
    		default:return;

      }

